function Info() {
  return (
    <section id='info'>
        <img src={imgSelfie} alt="Selfie" ></img>
        <h2>Veronica Sanchez Justicia</h2>
        <p>Full Stack Web Developer, Backend & Frontend | Systems Administrator</p>
        <a href="#experience">
            View Experience
        </a>
    </section>
  );
}

export default Info;
